import{_ as a,a as t,b as r,c as i,d as o,e as n,f as l,g as s,h as c}from"./chunks/pixhawk_connections.DpMyPao2.js";import{_ as h,c as p,a8 as d,o as u}from"./chunks/framework.BDnHobkS.js";const T=JSON.parse('{"title":"DATAGNSS GEM1305 RTK Receiver with antenna","description":"","frontmatter":{},"headers":[],"relativePath":"zh/gps_compass/rtk_gps_gem1305.md","filePath":"zh/gps_compass/rtk_gps_gem1305.md"}'),m={name:"zh/gps_compass/rtk_gps_gem1305.md"};function g(f,e,b,w,k,_){return u(),p("div",null,e[0]||(e[0]=[d('<h1 id="datagnss-gem1305-rtk-receiver-with-antenna" tabindex="-1">DATAGNSS GEM1305 RTK Receiver with antenna <a class="header-anchor" href="#datagnss-gem1305-rtk-receiver-with-antenna" aria-label="Permalink to &quot;DATAGNSS GEM1305 RTK Receiver with antenna&quot;">​</a></h1><p>GEM1305 is a RTK receiver with antenna designed and manufactured by <a href="https://www.datagnss.com/" target="_blank" rel="noreferrer">DATAGNSS</a>.</p><p>GEM1305 is based on the new generation CYNOSURE IV dual-core GNSS SoC. It supports RTK functionality with a maximum data update rate of 10Hz, and comes with cables for connecting to GPS ports on most Pixhawk devices.</p><img src="'+a+'" width="500px" alt="DATAGNSS GEM1305 RTK Receiver"><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>GEM1305 RTK doesn&#39;t support moving base mode yet.</li><li>GEM1305 RTK does not include a compass.</li></ul></div><h2 id="购买渠道" tabindex="-1">购买渠道 <a class="header-anchor" href="#购买渠道" aria-label="Permalink to &quot;购买渠道&quot;">​</a></h2><ul><li><p><a href="https://www.datagnss.com/collections/gnss-for-drone/products/gem1305" target="_blank" rel="noreferrer">GEM1305 RTK receiver with antenna</a> (www.datagnss.com)</p><img src="'+t+'" width="500px" alt="DATAGNSS GEM1305 RTK Receiver"></li><li><p><a href="https://www.datagnss.com/collections/gnss-for-drone/products/dgm10-rtk-receiver" target="_blank" rel="noreferrer">DGM10 RTK Receiver</a> (same receiver in a casing).</p><p><img src="'+r+'" alt="dgm10rtkreceiver.png"></p></li></ul><h2 id="主要特性" tabindex="-1">主要特性 <a class="header-anchor" href="#主要特性" aria-label="Permalink to &quot;主要特性&quot;">​</a></h2><ul><li>Full constellation, multi-frequency GNSS satellite receiver</li><li>Support RTK with up to 10hz output rate</li><li>Standard UART serial interface</li><li>Lightweight only 50g or 26g(NANO RTK receiver)</li><li>High performance antenna</li></ul><h2 id="frequencies" tabindex="-1">Frequencies <a class="header-anchor" href="#frequencies" aria-label="Permalink to &quot;Frequencies&quot;">​</a></h2><ul><li>GPS/QZSS: L1 C/A, L5C</li><li>GLONASS: L1OF</li><li>BEIDOU: B1I, B2a</li><li>GALILEO: E1, E5a</li><li>IRNSS: L5</li></ul><h2 id="gnss" tabindex="-1">GNSS <a class="header-anchor" href="#gnss" aria-label="Permalink to &quot;GNSS&quot;">​</a></h2><ul><li>128 hardware channels</li><li>3D accuracy: <strong>1.5m</strong> CEP</li><li>RTK accuracy: <strong>2cm</strong> +1PPM(H), 3cm+1PPM(V)</li></ul><h2 id="interface" tabindex="-1">Interface <a class="header-anchor" href="#interface" aria-label="Permalink to &quot;Interface&quot;">​</a></h2><ul><li>UART: 230400bps default</li><li>SMA connector for antenna</li><li>Output rate 5Hz default, up to 10Hz</li><li>Main power supply: 4.7~5.2V</li></ul><h2 id="protocol" tabindex="-1">Protocol <a class="header-anchor" href="#protocol" aria-label="Permalink to &quot;Protocol&quot;">​</a></h2><ul><li>NMEA-0183 output</li><li>RTCMv3 input/output</li></ul><h2 id="environment" tabindex="-1">Environment <a class="header-anchor" href="#environment" aria-label="Permalink to &quot;Environment&quot;">​</a></h2><ul><li>Operating temp. -20~85°C</li></ul><h2 id="dimension-and-weight" tabindex="-1">Dimension and Weight <a class="header-anchor" href="#dimension-and-weight" aria-label="Permalink to &quot;Dimension and Weight&quot;">​</a></h2><ul><li>55x55x12mm</li><li>50g (GEM1305) 26g (NANO with Helix)</li></ul><h2 id="针脚定义" tabindex="-1">针脚定义 <a class="header-anchor" href="#针脚定义" aria-label="Permalink to &quot;针脚定义&quot;">​</a></h2><p>The board is connected to the autopilot via UART interface.</p><p><img src="'+i+'" alt="GEM1305 connector"></p><p>The 1.25mm pitch 6P connector (from left: PIN1 to PIN6):</p><ul><li>1: GND</li><li>2: NC</li><li>3: PPS</li><li>4: Rx</li><li>5: Tx</li><li>6: 5V</li></ul><p>The board does not include a compass and so does not require connections for a compass part.</p><h2 id="硬件安装" tabindex="-1">硬件安装 <a class="header-anchor" href="#硬件安装" aria-label="Permalink to &quot;硬件安装&quot;">​</a></h2><p>RTK requires a base RTK module attached to the ground station, and a rover RTK module on the vehicle. The data from the base needs to be transmitted to the drone via telemetry radio and inputed into the RTK receiver on the rover.</p><p><img src="'+o+'" alt="RTK setup overview"></p><p>The setup/connections for base and rover modules are shown below.</p><h3 id="base-setup-gcs" tabindex="-1">Base Setup (GCS) <a class="header-anchor" href="#base-setup-gcs" aria-label="Permalink to &quot;Base Setup (GCS)&quot;">​</a></h3><p>The base station connections are shown in the diagram below, along with the connection to a telemetry radio.</p><p><img src="'+n+'" alt="Base module setup"></p><p>Note that for the base we recommend the <a href="https://www.datagnss.com/collections/gnss-for-drone/products/multi-band-rtk-receiver-package" target="_blank" rel="noreferrer">NANO RTK Receiver</a> because it is easier to setup.</p><img src="'+l+'" width="500px" alt="DATAGNSS NANO RTK Receiver"><p>See to <a href="https://wiki.datagnss.com/index.php/GEM1305-autopilot#Base_station_setup" target="_blank" rel="noreferrer">How to setup Base station</a> for information on how to configure the module for use as a base station (not including step 6 and later, for which you would QGroundControl instead of Mission Planner).</p><h3 id="rover-setup-px4" tabindex="-1">Rover Setup (PX4) <a class="header-anchor" href="#rover-setup-px4" aria-label="Permalink to &quot;Rover Setup (PX4)&quot;">​</a></h3><p>The rover setup showing connections to a GPS port and the (required) connection to a telemetry radio are shown in the diagram below.</p><p><img src="'+s+'" alt="Rover module and pixhawk big picture connections"></p><p>The diagram below shows the wiring from the <code>GPS2</code> port on the Pixhawk 6c flight controller. Note that an appropriate cable is supplied for this purpose.</p><p><img src="'+c+'" alt="Rover module setup"></p><p>GPS and RTK configuration on PX4 via <em>QGroundControl</em> is plug and play (see <a href="./../gps_compass/rtk_gps.html">RTK GPS</a> for more information).</p><h2 id="package-list" tabindex="-1">Package List <a class="header-anchor" href="#package-list" aria-label="Permalink to &quot;Package List&quot;">​</a></h2><ul><li>GEM1305 RTK Receiver</li><li>DG-6P-C01, GH-1.25mm-6P cable</li></ul><h2 id="resources" tabindex="-1">Resources <a class="header-anchor" href="#resources" aria-label="Permalink to &quot;Resources&quot;">​</a></h2><ul><li><a href="https://wiki.datagnss.com/index.php/GEM1305" target="_blank" rel="noreferrer">GEM1305 2D drawing file</a></li><li><a href="https://wiki.datagnss.com/images/3/31/EVK-DG-1206_V.2.0.pdf" target="_blank" rel="noreferrer">NANO RTK Receiver 2D drawing file</a></li><li><a href="https://wiki.datagnss.com/index.php/GEM1305" target="_blank" rel="noreferrer">GEM1305 Wiki</a> (DATAGNSS WiKi)</li><li><a href="https://wiki.datagnss.com/index.php/HED-10L" target="_blank" rel="noreferrer">HED-10L Heading RTK Receiver</a></li></ul><h2 id="more-information" tabindex="-1">More information <a class="header-anchor" href="#more-information" aria-label="Permalink to &quot;More information&quot;">​</a></h2><ul><li><a href="https://www.datagnss.com/collections/evk/products/tau951m-1312-tiny-evk" target="_blank" rel="noreferrer">NANO RTK Receiver</a></li><li><a href="https://www.datagnss.com/collections/rtk-antenna/products/smart-helix-antenna" target="_blank" rel="noreferrer">HELIX Antenna for RTK</a></li><li><a href="https://www.datagnss.com/collections/rtk-antenna/products/antenna-agr6302g" target="_blank" rel="noreferrer">RTK Antenna AGR6302G</a></li><li><a href="https://www.datagnss.com/collections/rtk-antenna/products/at400-multi-band-antenna-for-rtk" target="_blank" rel="noreferrer">AT400 RTK Antenna</a></li></ul>',49)]))}const S=h(m,[["render",g]]);export{T as __pageData,S as default};
